  const style1 = { background: "#1e1d2a" };

    console.log(style1);


  return (
    <Items>
      <Logo>
        <img src={logo} alt="logo" />
      </Logo>
      {sidebarItems.data.map((item) => (
        <Link to={item.link} key={item.id}>
          <Item stlye={style}>
            <Wrapper>
              <img style={style} src={item.icon} alt={item.link} />
              <Border style={item.style} />
              <Border1 stlye={item.style} />
            </Wrapper>
          </Item>
        </Link>
      ))}
    </Items>
  );
};

export default Sidebar;
